function setCookie(cname,cvalue,exdays){var d=new Date;d.setTime(d.getTime()+24*exdays*60*60*1e3);var expires="expires="+d.toGMTString();document.cookie=cname+"="+cvalue+"; "+expires}function getCookie(cname){for(var name=cname+"=",ca=document.cookie.split(";"),i=0;i<ca.length;i++){var c=ca[i].trim();if(0==c.indexOf(name))return c.substring(name.length,c.length)}return""}document.oncontextmenu=()=>!1,document.onselectstart=()=>!1,document.onkeydown=()=>!1,window.nowPage=0;class Img extends Loader{static imgs={error:"data/img/error.png",title:"data/img/title.png",1:"data/img/1.png",2:"data/img/2.png",3:"data/img/3.png",4:"data/img/4.png",s1425:"data/img/s1425.png",t002:"data/img/t002.png",t005:"data/img/t005.png",t009:"data/img/t009.png",t014:"data/img/t014.png","t002-1":"data/img/t002-1.png","t002-2":"data/img/t002-2.png","t002-3":"data/img/t002-3.png"};static getImg(id){return this.imgs[id]?this.imgs[id]:this.getImg("error")}}function createElement(elementParam){var element=document.createElement(elementParam.type);if(elementParam.attribute)for(var attributeKey of Object.keys(elementParam.attribute))"img"==elementParam.type&&"imgId"==attributeKey?element.src=Img.getImg(elementParam.attribute[attributeKey]):element[attributeKey]=elementParam.attribute[attributeKey];if(elementParam.class)for(var className of elementParam.class)element.classList.add(className);if(elementParam.chlidren)for(var chlidrenParam of elementParam.chlidren)element.appendChild(createElement(chlidrenParam));return element}window.createElement=createElement,window.Img=Img,document.addEventListener("DOMContentLoaded",()=>{Img.loadImgs.bind(Img)(()=>document.getElementById("titleimg").src=Img.getImg("title"))});